                        borderWidth: 2 //Breite der Linie

                        }
                    ]
                }}

                options={{
                    scales: {
                        yAxes: [{
                            type: 'linear',
                            ticks: {
                            beginAtZero: false
                            }
                        }]
                    }
                }
                }/>


        </div>
      )

    }

// }


export default chart;
